  \"2016-04-19T02:28:05.466753\",\n\t\"name\": \"recycle-right-campaign-routes\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Starting in October, Austin Resource Recovery
  will send a team of trained staff to survey the materials in the recycling carts
  of approximately 13,000 residents throughout the City of Austin. The team, called
  the u201cRecycle Right Crew,u201d will briefly look inside each cart to check for
  correct and unaccepted items. Each survey will take only about 15 seconds. We will
  post the results of each of the surveyed areas online. Check back soon to see how
  each areau2019s recycling efforts compare.\",\n\t\"license_title\": \"License Not
